import React, { Fragment } from 'react'
import fenrir from '../data/fenrir.png'

const Navbar = () => {
    return(
    <Fragment>
        <nav class="navbar navbar-dark bg-dark">
        <div class="container-fluid">
            <img src={fenrir} alt='logotipo fenrir' width="40" height="40"/>
            <a class="navbar-brand" href="">Sobre mi</a>
            <a class="navbar-brand" href="">Proyectos</a>
            <a class="navbar-brand" href="">Contacto</a>
            <a class="navbar-brand" href="">Habilidades</a>
        </div>
        </nav>
    </Fragment>
    );
}

export default Navbar;
